import React from 'react';

function Header(props){

   // const handleClick = () => {
   //    handleLoginClick();
   // }

   return <nav>
      <ul>
         <li><h1>KeeperApp</h1></li>
         <li><button onClick = {props.handleLoginClick("Login")} className = "loginicon">Login</button></li>
         <li><button onClick = {props.handleLoginClick("SignUp")} className = "loginicon">SignUp</button></li>
      </ul>
      </nav>
   
}

export default Header;
